// export default Queue;
import React, { useState } from 'react';
import './Queue.css';
import logo from '../../assets/food.jpg';
import { enQueue, updateQueue } from '../../../../routes';
import { notify } from '../../utils/notify';
import axios from 'axios';

const Queue = () => {
    const [selectedPax, setSelectedPax] = useState(2);
    const [phoneNumber, setPhoneNumber] = useState('');
    const [showPopup, setShowPopup] = useState(false);
    const [email, setEmail] = useState('');
    const [waitingTime, setWaitingTime] = useState(15); // Set a default waiting time

    const handleSubmit = (e) => {
        e.preventDefault();
        console.log('Pax:', selectedPax);
        console.log('Phone Number:', phoneNumber);
        // You can add further logic to handle the form submission
        setShowPopup(true);
    };

    const handleSignUp = (e) => {
        e.preventDefault();
        console.log('Email:', email);
        // Add logic to handle the email sign-up
    };

    const closePopup = () => {
        setShowPopup(false);
    };

    const addQueue = async (values) => {
        try {
            const response = await axios.post(`${enQueue}`, {
                phoneNumber: values['phoneNumber'],
                restaurantID: values['restaurantID'],
                numOfPax: values['numOfPax'],
            });
            if (response.status !== 200) {
                notify('error', response.data ?? 'Error adding queue. Please try again');
                return;
            }
            notify('success', 'Queue added successfully');
        } catch (err) {
            notify('error', err.response.data ?? 'Error adding queue. Please try again');
        }
    };

    return (
        <div className="queue-container">
            <h2 className="queue-header">Register to Queue</h2>
            <form className="form-container" onSubmit={handleSubmit}>
                <div className="form-group">
                    <label for="pax">Number of Pax:</label>
                    <input type="number" id="numOfPax" name="pax" className="input-field" value={selectedPax} onChange={(e) => setSelectedPax(e.target.value)} min="1" max="12" required></input>
                </div>
                <div className="form-group">
                    <label for="phoneNum">Phone Number:</label>
                    <input
                        type="tel"
                        className="input-field"
                        name="phoneNum"
                        placeholder="Enter phone number"
                        value={phoneNumber}
                        onChange={(e) => setPhoneNumber(e.target.value)}
                        pattern="[689][0-9]{7}"
                        title="Phone number should start with 6, 8, or 9 and be 8 digits long"
                        required
                    />
                </div>
                <button type="submit" className="submit-button">
                    Confirm to queue
                </button>
            </form>

            {showPopup && (
                <div className="popup">
                    <div className="popup-inner">
                        <div className="confirmation-text">
                            <h3>Thank You For Queueing!</h3>
                            <p>Below is the confirmed details and approximate waiting time for your queue</p>
                            <p>Pax: {selectedPax}</p>
                            <p>Phone Number: {phoneNumber}</p>
                            <p>Waiting Time: {waitingTime} minutes</p>
                            <br></br>
                            <form onSubmit={handleSignUp} className="sign-up-form">
                                <h4>Sign Up Now!</h4>
                                <p>Receive promotions and exclusive offers delivered to your inbox</p>
                                <input
                                    type="email"
                                    className="input-field"
                                    placeholder="Enter your email"
                                    value={email}
                                    onChange={(e) => setEmail(e.target.value)}
                                    required
                                />
                                <button type="submit" className="confirm-submit-button">
                                    Sign Up
                                </button>
                            </form>
                            <br></br>
                            <button onClick={closePopup} className="close-button">Close</button>
                        </div>
                        <div className="image">
                            <img src={logo} alt="Food" />
                        </div>
                    </div>
                </div>
            )}

        </div>
    );
};

export default Queue;
